import {Route} from 'react-router-dom'
import Navbar from "./components/Navbar";
import Home from './components/Home'
import Login from './components/Login';
import Register from './components/Register';


function App() {
  return (
    <div className="App">
      <Navbar/>

      <Route>
        <Home/>
      </Route>

      <Route>
        <About/>
      </Route>

      <Route>
        <Login/>
      </Route>

      <Route>
        <Register/>
      </Route>
    </div>
  );
}

export default App;
